import React from 'react';
import { NavLink } from 'react-router-dom';
import homeigm from '../Images/miles.jpg';
import Same from './Same';

const About=()=>{
    return(
        <>
           <Same
           title="SovTech Graduate Programme"
           text="We believe great software is the 
           perfect combination of artistry, 
           engineering, and people."
           imgsrc={homeigm}
            btn="Read more"
           />

       </>
    )
}
export default About;
